const VehicleImage = [{
  name: `Sand Crawler`,
  description: `Sandcrawlers are huge treaded fortresses used by Jawas as transportation and shelter. The sand-pitted vehicles, many meters in height, are equipped with a magnetic suction tube for sucking droids and scrap into their cargo chambers.`,
  vehicleImgSrc: `https://lumiere-a.akamaihd.net/v1/images/sandcrawler-main_eb1b036b.jpeg`
}, {
  name: `T-16 skyhopper`,
  description: `A high-performance airspeeder capable of reaching a planet’s troposphere, T-16 skyhoppers were fast and maneuverable – a combination that could be dangerous for young pilots. Luke Skywalker owned a two-man skyhopper, but burned out the instrumentation during a reckless trip through Beggar’s Canyon. He was left to play idly with a model of his beloved craft until he could make the T-16 airworthy again. The controls of a T-16 were similar to those of a T-65 X-wing, which allowed Luke to join the rebel attack on the Death Star at Yavin.`,
  vehicleImgSrc: `https://lumiere-a.akamaihd.net/v1/images/databank_t16skyhopper_01_169_ad69e901.jpeg`
}, {
  name: `X-34 landspeeder`,
  description: `Luke Skywalker owned one of these nondescript but speedy landspeeders, racing the sand-pocked and sun-faded craft across the desert between the Lars homestead and outposts such as Tosche Station and Anchorhead. The X-34’s powerful repulsorlift engine that allows it to float about a meter above the ground, augmented by a trio of air-cooled thrust turbines. Luke’s speeder was old and battered, and missing the port turbine’s cowling, but tinkering and careful maintenance – essential in the harsh environment of Tatooine -- kept it in good working order. After the death of his aunt and uncle, Luke sold his speeder in Mos Eisley to help pay for passage to Alderaan.`,
  vehicleImgSrc: `https://lumiere-a.akamaihd.net/v1/images/E4D_IA_1136_6b8704fa.jpeg`
}, {
  name: `TIE/LN starfighter`,
  description: `The TIE fighter was the unforgettable symbol of the Imperial fleet. Carried aboard Star Destroyers and battle stations, TIE fighters were single-pilot vehicles designed for fast-paced dogfights with Rebel X-wings and other starfighters. The iconic TIE fighter led to other models in the TIE family including the dagger-shaped TIE Interceptor and the explosive-laden TIE bomber. The terrifying roar of a TIE's engines would strike fear into the hearts of all enemies of the Empire.`,
  vehicleImgSrc: `https://lumiere-a.akamaihd.net/v1/images/TIE-Fighter_25397c64.jpeg`
}, {
  name: `Snowspeeder`,
  description: `When stationed on Hoth, the Rebel Alliance modified T-47 airspeeders to become snowspeeders, fast flying conveyances for patrol and defense of their hidden base. It took some doing to keep the crippling cold from permanently grounding their airforce, but Rebel ingenuity overcame the relentless Hoth elements. The T-47 airspeeder is a small, wedge-shaped craft with two forward-facing laser cannons. In its rear arc is a harpoon gun fitted with a heavy-duty tow cable. The snowspeeder is a two-man vessel, with a pilot and rear-facing tailgunner.`,
  vehicleImgSrc: `https://lumiere-a.akamaihd.net/v1/images/snowspeeder_ef2f9334.jpeg`
}, {
  name: `TIE bomber`,
  description: `The Empire uses flights of its specialized double-hulled TIE bombers to drop vast quantities of munitions on rebellious planets and targets in space, delivering devastating attacks with frightening accuracy. `,
  vehicleImgSrc: `https://lumiere-a.akamaihd.net/v1/images/tie-bomber-main_d4d9b979.jpeg`
}, {
  name: `AT-AT`,
  description: `The All Terrain Armored Transport, or AT-AT walker, is a four-legged transport and combat vehicle used by the Imperial ground forces. Standing over 20 meters tall with blast-impervious armor plating, these massive constructs are used as much for psychological effect as they are for tactical advantage.`,
  vehicleImgSrc: `https://lumiere-a.akamaihd.net/v1/images/AT-AT_89d0105f.jpeg`
}, {
  name: `AT-ST`,
  description: `While not as imposing as its larger AT-AT walker cousin, the AT-ST nonetheless served as a significant addition to the Imperial side of battlefields in the Galactic Civil War. The two-man craft is lightly armed with chin-mounted laser cannons, and side-mounted weapon pods. The two-legged transport, dubbed the scout walker by many, serves as a reconnaisance and patrol vehicle, often flanking approaching AT-ATs and mopping up infantry that sneaks past the larger walkers. The Imperials used AT-STs in both the Battle of Hoth and the Battle of Endor.`,
  vehicleImgSrc: `https://lumiere-a.akamaihd.net/v1/images/e6d_ia_5724_a150e6d4.jpeg`
}, {
  name: `Storm IV Twin-Pod cloud car`,
  description: `These brick-colored atmospheric vehicles keep the peace in the skies of Bespin. Cloud cars feature twin “pods” connected by a repulsorlift engine, and are equipped with light blaster cannons. Each cloud car has a pilot and a gunner, who work in tandem to intercept starships bound for Cloud City, question their captains and take defensive measures as needed.`,
  vehicleImgSrc: `https://lumiere-a.akamaihd.net/v1/images/cloud-car-main-image_8d2e4e89.jpeg`
}, {
  name: `Sail barge`,
  description: `Jabba the Hutt valued money and power, and enjoyed showing off just how much he had of both. The Khetanna, his luxury sail barge, was among the crimelord’s most extravagant purchases: a massive transport that carried up to 500 passengers, maintained a crew of 26, and was outfitted with space for live music and entertainment. It was manufactured by Ubrikkian, measuring 30 meters long and equipped with a heavy blaster cannon -- an essential feature for Jabba’s lifestyle. Indeed, the craft was symbolic of Jabba’s hubris and ego, and played a large part in his downfall.`,
  vehicleImgSrc: `https://lumiere-a.akamaihd.net/v1/images/open-uri20150608-27674-168ubjg_976dbf1d.jpeg`
}, {
  name: `Bantha-II cargo skiff`,
  description: `The Bantha-II cargo skiff was a common repulsor-based transport outside the Republic (and later the Empire.) They were extremely durable making them an austere choice for desert climes and perfect transports for passengers, cargo, or slaves for the Hutt Crime Syndicate or the slave traders of Zygerria. They were little more than floating platforms, and easily identified by their rust coloring, reinforced bows, and intermittent guard-rails around the perimeter. They came equipped with planks, making them the preferred execution conveyance for the vile gangster Jabba the Hutt, who loved to drop his enemies into pits full of monsters. Shortly before his untimely demise, Jabba forced Luke Skywalker to walk a skiff’s plank over the Great Pit of Carkoon. That was the last mistake he ever made.`,
  vehicleImgSrc: `https://lumiere-a.akamaihd.net/v1/images/skiff_9d81647a.jpeg`
}, {
  name: `TIE/IN interceptor`,
  description: `Faster and better-armed descendents of regular TIE fighters, TIE interceptors defended the second Death Star at the Battle of Endor. The bent-winged fighters swarmed the Rebel fleet in a terrifying display of the Empire's military might.`,
  vehicleImgSrc: `https://lumiere-a.akamaihd.net/v1/images/tie-interceptor-2_b2250e79.jpeg`
}, {
